import aboutImage from '../../images/Get in touch-cuate.png'

function About() {
  return (
    <>
    <div class="container">
  <div class="row gx-1 ">

    <div class="col-md-6">

    </div>

    <div class="col-md-6">
    <img
              src={aboutImage}
              alt="home pic"
              className="img-fluid"

            />
    </div>

  </div>
</div>

  </>
  );
}

export default About;
